Ristkülikul $ABCD$ on keskpunkt $O$ ja $AB/AD=k$. Punkt valitakse juhuslikult ristküliku $ABCD$ sisemusest. Milline on tõenäosus, et see on lähemal $O$-le kui ükskõik millisele neljast tipust?  [asy]
size(200);
draw((-250,100)--(250,100)--(250,-100)--(-250,-100)--cycle);
dot((0,0));
label("$O$",(0,0),N);
label("$A$",(-250,100),NW); label("$B$",(250,100),NE); label("$C$",(250,-100),SE); label("$D$",(-250,-100),SW);[/asy]

